import './css/UI.css';

function Content(){
    return(
      <div>

      <div className="list">
      <div className="title">Evening Activity</div>
      <div className="desc">Go out and buy groceries.</div>
      </div>

      <div className="list">
      <div className="title">Study for an exam</div>
      <div className="desc">Check notes on Software Engineering.</div>
      </div>

      <div className="list">
      <div className="title">Plants !</div>
      <div className="desc">Remember to water cactus.</div>
      </div>


      </div>
  );
}
export default Content;
